    \ Reference:  12 Day Pre-Primary Report (4/1/08 ? 7/16/08)\t\t\t\t\t    Dear Ms.
    Grant:  Please be advised that we have amended the 12 Day Pre-Primary report to
    correct the following discrepancies.  Item one addresses a discrepancy in Column
    B lines 7(a), 7(c), 17 and 22.  There was a $122.21 discrepancy in the cycle-to-date
    disbursements.  A disbursement was erroneously added to the April 2008 quarterly
    report after the filing.  This error had to do with a misunderstanding as to how
    we were charged for credit card processing through a new website. We did a thorough
    investigation, and all is now properly recorded.    We found that eight disbursements
    totaling $187.92 in the first quarter of 2008 and fourteen disbursements totaling
    $66.07 in the second quarter of 2008 were not properly entered into our database.
    \ These disbursements have been added and a first quarter 2008 amended report
    will be filed.  All of these disbursements are processing fees from the same clearinghouse.
    \ The contribution data imports directly into the database.  Our data entry team
    did not know that the processing fees were not automatically entered into disbursements.
    \ Item two addresses the Cycle-to-Date contributions for John Bishop, National
    Community Pharmacists and Maynard Oliverius.    1.\tThere are two John Bishops
    in our donor base.  Mr. Bishop from Ithaca, NY has contributed $994, and Mr. Bishop
    of Atchison, KS has contributed $500.    2.\tThe National Community Pharmacists
    had two records in our database.  On March 6, 2008 a $500 contribution made by
    the National Community Pharmacists was entered as a new record.  These duplicate
    records have been combined.  3.\tAn in-kind contribution of $1,436.12 was made
    by Sarah Oliverius and attributed to Maynard Oliverius.  The record was changed
    after the filing.     Item three also addresses Cycle-to-Date contributions.  1.\tOn
    the July 2007 Quarterly there is a $500 contribution made by Philip Elwood on
    June 14, 2007.  On May 29, 2008 Mr. Elwood contributed $500; this contribution
    is reflected in the July 2008/Pre-Primary report.  The aggregate total for Mr.
    Elwood?s giving is $1,000.  2.\tAn in-kind contribution of $1,436.12 was made
    by Sarah Oliverius and attributed to Maynard Oliverius.  The record was changed
    after the filing.  3.\tIrvin Ray Robinson had two records:  Irv Robinson and Irvin
    Ray Robinson.  These records have been combined.  4.\tMark Sinovec had two records:
    Mark Synovec and Mark Sinovec.   These records have been combined.  5.\tRobert
    S. Smith had two records: Dr. Steve Smith and Robert S. Smith.  These records
    have been combined.  If you require further information or clarification, please
    contact me.    Sincerely,      Katie McCollom  Finance Director  Boyda for Congress
    \ "
